// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom'; // Import Link from react-router-dom
import EventListPage from './pages/EventListPage';
import EventCreationPage from './pages/EventCreationPage';

function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Event List</Link>
            </li>
            <li>
              <Link to="/create">Create Event</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/create" component={EventCreationPage} />
          <Route path="/" component={EventListPage} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
